ction to the company who employs me, my colleagues, and our mission has strengthened significantly. üíï HOW did this happen? WHY did this happen? And is this something I can hold on to for the long run? üíì I believe I can. And I believe you can too. When we focus our emotional #energy on contributing to the world around us, we can thrive. When we pour our #compassion for others into our relationships with them, we thrive. But we cannot pour from an empty cup and we cannot share our lives in HEALTH and JOY with others if we do not ensure that we, too, can thrive. That means giving not only OF ourselves, but TO ourselves. üíì I have been able to improve my physical #health and my #mental wellness through this pandemic by staying #present and finding ways to contribute to the world around me. We can‚Äôt all give in the same ways. We can‚Äôt all reap joy and love in the same manners. But we can all CONTRIBUTE positively during difficult times and find ways to thrive and help others thrive as well. üíï";}i:251;a:1:{s:14:"comments_count";i:0;}i:252;a:1:{s:11:"likes_count";i:0;}i:253;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuU-ndAMld";}i:254;a:1:{s:5:"image";s:258:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118793336_796030644504764_199537736234253251_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=108&_nc_ohc=ARV9Na4KLrkAX9ZDpka&_nc_tp=15&oh=d2acf80cb30177932b9ae7690aeb96d6&oe=5F7A61CD";}i:255;a:1:{s:4:"type";s:5:"image";}i:256;a:1:{s:8:"owner_id";i:35713847278;}i:257;a:1:{s:14:"owner_username";s:0:"";}i:258;a:1:{s:14:"owner_fullname";s:0:"";}i:259;a:1:{s:9:"owner_pic";s:0:"";}}